import React from "react";
import FotoAlmet from "./foto/fotoalmet.JPG"

class TentangSaya extends React.Component {
    render() {
        return(
            <div>
                <h2>TentangSaya</h2>
                <img height={400} src={FotoAlmet} alt="ini foto" />
                <p>saya adalah siswa telkom yang pintar ngoding</p>
            </div>
        )
    }
}

export default TentangSaya;
